import React from "react";

function CareerMapper() {
  return <h2>CMY</h2>;
}

function CareerFinder({ routes }) {
  return <h2>CFY</h2>;
}

const routes = [
  {
    path: "/career-mapper",
    component: CareerMapper
  },
  {
    path: "/career-finder",
    component: CareerFinder
  }
];

export default routes
